import React, { useEffect } from 'react'
import { queryPokemons } from '../../hooks/query'

export default () => {
  const {
    data,
    actions: { getPaginated }
  } = queryPokemons()

  useEffect(() => {
    getPaginated()
  }, [])

  return (
    <div>{data.paginated.paginatedData?.results.map((item) => item.name)}</div>
  )
}
